import React from 'react';
// import './css/style.css';


function MakeSponsor(props) {
	return (
		<div className={props.position}>
			<a
	        	href={props.url}
				// target="_blank"
	        >
			<img
				className={props.className}
				src={props.logo}
			/>
			</a>
		</div>
	);
}

//Rows
class Rows extends React.Component {
	constructor(props) {
		super(props);

	}

	renderSponsor(p,u,c,l) {
		return(
			<MakeSponsor
				position={p}
				url={u}
				className={c}
				logo={l}
			/>
		);
	}

	render() {
		return(
			<div>
		{/*Diamond Sponsors*/}
			<div className="row sponsors">
		        {this.renderSponsor("col-sm-4 TRowePos", //Positioning
		            				"https://www3.troweprice.com/usis/corporate/en/home.html", //Url
									"img-fluid TRoweLogo", //Logo size
									"../img/sponsors/TRowe.png") //Path to Logo
		        }
		    </div>
		    <br />
        	<br />
    	{/*Gold Sponsor*/}
		    <div className="row sponsors">
		    	{this.renderSponsor("col-sm-4",
		            				"http://buildportcovington.com/",
									"img-fluid portLogo",
									"../img/sponsors/port-covington.png")
		        }
		        {this.renderSponsor("col-sm-4",
		            				"https://www.boozallen.com/",
									"img-fluid BoozLogo",
									"../img/sponsors/Booz-Allen-Hamiliton-logo.png")
		        }
		        {this.renderSponsor("col-sm-4 leidosPos",
		            				"http://www.leidos.com/",
									"img-fluid leidosLogo",
									"../img/sponsors/leidos.png")
		        }

		    </div>
		    <br />
        	<br />
        	<div className="row sponsors">
		    	{this.renderSponsor("col-sm-4",
		            				"http://wellerdevelopment.com/",
									"img-fluid wellerLogo",
									"../img/sponsors/weller-development.png")
		        }
		        {this.renderSponsor("col-sm-4",
		            				"https://www.ltsnet.net/",
									"img-fluid ltsLogo",
									"../img/sponsors/LTS.png")
		        }
		        {this.renderSponsor("col-sm-4",
		            				"https://www.intelligencecareers.gov/nsa/",
									"img-fluid nsaLogo",
									"../img/sponsors/nsa.png")
		        }
		    </div>
		    <br />
        	<br />
        {/*Silver Sponsors*/}
        	<div className="row sponsors">
		    	{this.renderSponsor("col-sm-4",
		            				"http://clearedgeit.com/",
									"img-fluid clearLogo",
									"../img/sponsors/clear-edge.png")
		        }
		        {this.renderSponsor("col-sm-4",
		            				"http://www.jhuapl.edu/",
									"img-fluid aplLogo",
									"../img/sponsors/jhuapl.png")
		        }
		        {this.renderSponsor("col-sm-4",
		            				"https://freedomconsultinggroup.com/",
									"img-fluid freedomLogo",
									"../img/sponsors/freedom.png")
		        }
		    </div>
		{/*Bronze Sponsors*/}
        	<div className="row sponsors">
		    	{this.renderSponsor("col-sm-4 jpMorgonPos",
		            				"https://www.jpmorgan.com/country/US/en/jpmorgan",
									"img-fluid jpMorgonLogo",
									"../img/sponsors/jpMorgonPos.png")
		        }
		        {this.renderSponsor("col-sm-4",
		            				"https://facebook.com",
									"img-fluid",
									"../img/sponsors/facebook.png")
		        }
		        {this.renderSponsor("col-sm-4",
		            				"http://www.focusedsupport.com/",
									"img-fluid",
									"../img/sponsors/focused-support.png")
		        }
		    </div>
		    <br />
		    <br />
        	<div className="row sponsors">
		    	{this.renderSponsor("col-sm-4",
		            				"http://www.whiting-turner.com/",
									"img-fluid whitingLogo",
									"../img/sponsors/whiting-turner.png")
		        }
		        {this.renderSponsor("col-sm-4",
		            				"https://minerkasch.com",
									"img-fluid minerKaschLogo",
									"../img/sponsors/miner-kasch.png")
		        }
		        {this.renderSponsor("col-sm-4 intelliforcePos",
		            				"https://www.intelliforce-itsg.com/",
									"img-fluid intelliforceLogo",
									"../img/sponsors/intelliforce.png")
		        }
		    </div>
		    <br />
		    <br />
        	<div className="row sponsors">
		    	{this.renderSponsor("col-sm-4 alexRow",
		            				"https://entrepreneurship.umbc.edu",
									"img-fluid alexBrownLogo",
									"../src/img/sponsors/alex-brown.png")
		        }
		        {this.renderSponsor("col-sm-4",
		            				"https://www.csee.umbc.edu/",
									"img-fluid cseeLogo",
									"../src/img/sponsors/umbc-csee.png")
		        }
		        {this.renderSponsor("col-sm-4 coeitPos",
		            				"https://coeit.umbc.edu/",
									"img-fluid coeitLogo",
									"../src/img/sponsors/freedom.png")
		        }
		    </div>

		    </div>

		);
	}

}


// Final Render
class Sponsor extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			title: "Sponsors",
			open_bracket: "{ ",
			close_bracket: " }"
		}
	}

	renderSponsor(p,u,c,l) {
		return(
			<MakeSponsor
				position={p}
				url={u}
				className={c}
				logo={l}
			/>
		);
	}
	render() {
		return(
			<div className="wrapper">
		        <h1 className="section-header-gray">
		          <span className="bracket-color">{this.state.open_bracket}</span> {this.state.title}
		          <span className="bracket-color">{this.state.close_bracket}</span>
		        </h1>
		        <br />
		        <Rows />
		        <br />

		    </div>
     );
 }
}

export default Sponsor;
// export default SponsorPage;
